import { React, Component } from 'react'
import DataSetCard from './datasetCard'
import Typography from '@material-ui/core/Typography'
import { Link } from 'react-router-dom'
import Axios from 'axios'

class Home extends Component {
    async GetDataSets(idUser) {
        const url = 'http://localhost:8000';
        const endpoint = '/DataSet/Users/' + idUser;

        let data;

        await Axios.get(url + endpoint)
            .then(res => {
                data = res.data;
                console.log(data);
            });

        return this.BindDataSets(data);
    }

    BindDataSets(data) {
        return (
            <div className="DataSets">
                { data.map(item => (
                    <div key={item.ObjectID}>
                        <Link
                            to={'/DataSet/' + item.ObjectID}
                            style={{ textDecoration: 'none' }}
                        >
                            <DataSetCard dataSet={item} />
                        </Link>
                    </div>
                )) }
            </div>
        );
    }

    render() {
        return (
            <div className="home">
                <Typography variant="h4">Data Sets</Typography>
                { this.GetDataSets(this.props.idUser) }
            </div>
        );
    }
}

export default Home;
